import Timer from './Timer';
import Settings from './Settings';
import { useState } from 'react';

const[showSettings, setShowSettings] = useState(initialState, false);

function App() {
  return (
    <main>
      {showSettings ? <Settings /> : <Timer/>}
    </main>
  );
}

export default App;
